    "These users were not removed as beta testers:": "\u05de\u05e9\u05ea\u05de\u05e9\u05d9\u05dd \u05d0\u05dc\u05d4 \u05dc\u05d0 \u05d4\u05d5\u05e1\u05e8\u05d5 \u05db\u05d1\u05d5\u05d3\u05e7\u05d9 \u05d1\u05d8\u05d0:",
