    "These users will be allowed to enroll once they register:": "\u05d4\u05de\u05e9\u05ea\u05de\u05e9\u05d9\u05dd \u05d4\u05d1\u05d0\u05d9\u05dd \u05d9\u05d4\u05d9\u05d5 \u05e8\u05e9\u05d0\u05d9\u05dd \u05dc\u05d4\u05d9\u05e8\u05e9\u05dd \u05dc\u05d0\u05d7\u05e8 \u05e9\u05d9\u05e9\u05dc\u05d9\u05de\u05d5 \u05d0\u05ea \u05d4\u05e8\u05e9\u05de\u05ea\u05dd \u05dc\u05d0\u05ea\u05e8:",
