    "This Group Configuration is not in use. Start by adding a content experiment to any Unit via the {linkStart}Course Outline{linkEnd}.": "\u05d4\u05d2\u05d3\u05e8\u05ea \u05ea\u05e6\u05d5\u05e8\u05ea \u05e7\u05d1\u05d5\u05e6\u05d4 \u05d6\u05d5 \u05d0\u05d9\u05e0\u05d4 \u05d1\u05e9\u05d9\u05de\u05d5\u05e9. \u05d4\u05ea\u05d7\u05dc \u05d1\u05d4\u05d5\u05e1\u05e4\u05ea \u05e0\u05d9\u05e1\u05d5\u05d9 \u05ea\u05d5\u05db\u05df \u05dc\u05db\u05dc \u05d9\u05d7\u05d9\u05d3\u05d4 \u05d1\u05d0\u05de\u05e6\u05e2\u05d5\u05ea {linkStart}\u05ea\u05e8\u05e9\u05d9\u05dd \u05d4\u05e7\u05d5\u05e8\u05e1{linkEnd}.",
    "This Group Configuration is used in:": "\u05d4\u05d2\u05d3\u05e8\u05ea \u05d4\u05e7\u05d1\u05d5\u05e6\u05d4 \u05e0\u05de\u05e6\u05d0\u05ea \u05d1\u05e9\u05d9\u05de\u05d5\u05e9 \u05d1:",
